function makeXmastree(info) {
  const deco_pos = [{x:0,y:0}],
        random = (array) => {
          return array[Math.floor(Math.random()*array.length)];
        },
        randomInCircle = (angle) => {
          const theta = 2.0 * Math.PI * Math.random();
          const radius = Math.sqrt(Math.random()) * 10;
          return {
            x:radius * Math.cos(theta),
            y:radius * Math.sin(theta),
            realx:radius * Math.cos(theta + (angle * Math.PI / 180)),
            realy:radius * Math.sin(theta + (angle * Math.PI / 180))
          };
        },
        distance  = (p1, p2) => {
          return Math.sqrt(Math.pow(p2.x - p1.x, 2) + Math.pow(p2.y - p1.y, 2))
        };
  if (info.id == undefined) {info.id = Math.random().toString(36).slice(2)};
  if (info.tree == undefined) {info.tree = [41,41,41,41,41]};
  if (info.star == undefined) {info.star = 13};
  if (info.ball_amount == undefined) {info.ball_amount = 5};
  if (info.ball_color == undefined) {
    info.ball_color = [1,2,3,4,5,10,11,12,13,14,15,36]
  };
  if (info.ball_shape == undefined) {info.ball_shape = [0]};
  if (info.ball_deco_color == undefined) {info.ball_deco_color = 13};
  const Xmastree = {
    PARENT: [exports.obstacle],
    COLOR: info.tree[0],
    LABEL: "Christmas tree",
    TURRETS: [{/*SIZE   X    Y  ANGLE ARC */
      POSITION: [ 20,   0,   0,   30,   0,  1 ],
      TYPE: exports[info.id + "_hexagon1"] = {
        SHAPE: 6,
        COLOR: info.tree[1]
      }, }, {
      POSITION: [ 17,   0,   0,   0,   0,  1 ],
      TYPE: exports[info.id + "_hexagon2"] = {
        SHAPE: 6,
        COLOR: info.tree[2]
      }, }, {
      POSITION: [ 14,   0,   0,   30,   0,  1 ],
      TYPE: exports[info.id + "_hexagon3"] = {
        SHAPE: 6,
        COLOR: info.tree[3]
      }, }, {
      POSITION: [ 11,   0,   0,   0,   0,  1 ],
      TYPE: exports[info.id + "_hexagon4"] = {
        SHAPE: 6,
        COLOR: info.tree[4]
      }, }],
  };
  exports[info.id + "_ball_deco"] = {
    SHAPE: 0,
    COLOR: info.ball_deco_color
  };
  for (let i = 1; i <= info.ball_amount; i++) {
    let pos, bool, angle = 360 * Math.random()
    do {
      pos = randomInCircle(angle)
      bool = deco_pos.every((p) => {
        return (distance({x:pos.realx, y:pos.realy}, p) > 2);
      }) } while (!bool);
    deco_pos.push({x:pos.realx, y:pos.realy});
    Xmastree.TURRETS.push( {
      POSITION: [ 2.5,   pos.x,   pos.y,   angle,   0,  1 ],
      TYPE: exports[info.id + "_ball" + i] = {
        SHAPE: random(info.ball_shape),
        COLOR: random(info.ball_color),
        TURRETS: [{/*SIZE   X    Y  ANGLE ARC */
          POSITION: [  7,   0,   0,   0,   0,  1 ],
          TYPE: exports[info.id + "_ball_deco"],}]
      }
    },);
  };
  Xmastree.TURRETS.push( {
      POSITION: [ 11,   0,   0,   360 * Math.random(),   0,  1 ],
      TYPE: exports[info.id + "_star"] = {
        SHAPE:
          (function() {
            let star = [], theta = 0;
            while(star.length < 10){
              const length = (star.length % 2) ? 0.25 : 0.5,
              pos = [
                length * Math.cos(theta * Math.PI / 180),
                length * Math.sin(theta * Math.PI / 180)
              ];
              star.push(pos);
              theta += 36
            };
            return star;  
          })(),
        COLOR: info.star
      },
    });
  return Xmastree;
};

exports.XmasTree1 = makeXmastree({tree:[30,30,30,30,30],star:32,ball_color:[33,35],ball_shape:[3],ball_deco_color:7})
exports.XmasTree2 = makeXmastree({tree:[8,8,8,8,8],star:6,ball_color:[4,14],ball_shape:[4],ball_deco_color:0})